import { motion } from "framer-motion";
import React from "react";
function About() {


  return (
    <>
    <motion.div 
      className="centered"
      initial={{ y: 0, opacity: 1}}
      whileInView={{ y: -50, opacity: 0}} 
      transition={{ duration: 0.5 }}
    >
        <div className="about-title">
          <p>Half developer,</p>
          <p>half designer,</p>
          <p>full creative</p>
        </div>
      </motion.div>
    </>
  );
}

export default About;
